sys_variable_value.value:
(function execute(inputs, outputs) {
	try {
		var action_inputs = {};
		var headers = [];
		var aliasSysId = "";
		try {
			if (typeof (inputs.alias) == "object") {
				aliasSysId = inputs.alias.sys_id;
			} else {
				var alias = JSON.parse(inputs.alias);
				aliasSysId = alias.value;
			}
		} catch (e) {
			aliasSysId = inputs.alias;
		}
		var gr = new GlideRecord('sys_alias');
		gr.addQuery('sys_id', aliasSysId);
		gr.query();

		if (gr.next())
			action_inputs['connection_credential_alias'] = gr; // GlideRecord of table: sys_alias 
		else
			throw "Invalid Connection & Credential Alias";

		action_inputs['spreadsheet_id'] = inputs.spreadsheet; // String 
		action_inputs['sheet'] = inputs.sheet; // Dynamic Choice 
		action_inputs['range'] = 'A1:Z1'; // String 

		// Execute Synchronously: Run in foreground. Code snippet has access to outputs.
		var action_outputs = sn_fd.FlowAPI.executeAction('sn_g_sheets_spoke.get_cell_values', action_inputs);

		// Get Outputs:
		// Note: outputs can only be retrieved when executing synchronously.
		var values = action_outputs['values']; // Array.String
		var status = action_outputs['status']; // Choice
		var error_message = action_outputs['error_message']; // Choice

		if (status == "Success") {
			outputs.status = "Success";
			if (!values)
				throw "No headers in the sheet";
			var header_values = JSON.parse(values[0]);
			for (var i = 0; i < header_values.length; i++) {
				var header_obj = {
					name: header_values[i],
					label: header_values[i],
					value: ''
				};
				headers.push(header_obj);
			}
			outputs.headers = {
				data: headers
			};
		} else {
			outputs.status = "Error";
			outputs.error_message = error_message;
		}

	} catch (ex) {
		gs.error(ex);
		outputs.status = "Error";
		outputs.error_message = ex;
	}
})(inputs, outputs);

		//var sheets = action_outputs['variable2']; // Array.Object
		//var status = action_outputs['variable4']; // Choice
		//var error_message = action_outputs['variable5']; // Choice

